    @include onTablet {
      height: 330px;
      padding-bottom: 0;
    }

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include hover (transform, scale(1.05));
    @include hover (box-shadow, 5px 10px 8px $grayColor);

  }

  &__photo {
    position: absolute;
    height: 100%;
    width: 100%;

    object-fit: cover;
    object-position: center;

    &-cat {
      object-position: top;
    }
  }

  &__info {
    margin-bottom: 50px;
  }

  &__date {
    margin-bottom: 10px;
    color: $mainColor;
  }

  &__title {
    margin-bottom: 20px;

    @include onTablet {
      min-height: 60px;
    }
  }
}

sources.styles/blocks/form.scss:
.form {
  &__field-container {
    display: grid;

    @include onTablet {
      grid-template-columns: repeat(2, 65%);
    }

    @include onDesktop {
      grid-template-columns: repeat(2, 80%);
    }
  }

  &__field {
    line-height: 24px;
    outline: none;
    border-style: none;
    border-bottom: 1px solid $blackColor;
    padding-bottom: 3px;

    margin-bottom: 30px;

    &:hover {
      border-color: $mainColor;
      color: $mainColor;
    }

    &:focus {
      font-weight: 700;
      color: $blackColor;
    }

    &:-webkit-autofill,
    :-webkit-autofill:hover,
    :-webkit-autofill:focus {
      -webkit-animation-name: autofill;
      -webkit-animation-fill-mode: both;
    }
  }

  &__button-container {
    @include onTablet {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
      column-gap: 30px;
    }
  }
}

sources.styles/blocks/footer.scss:
.footer {
  background-color: $backgroundColor;
  color: $whiteColor;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  padding-top: 10px;

  @include onTablet {
    padding-top: 30px;
  }

  &__title {
    font-size: 18px;
    margin-bottom: 10px;

    @include onTablet {
      font-size: 20px;
      margin-bottom: 30px;
    }
  }

  &__block {
    margin-bottom: 50px;
  }

  &__contacts {
    margin-bottom: 30px;
  }

  &__icon {
    width: 20px;
    height: 20px;
  }

  &__social {
    display: flex;
    flex-direction: row;
    gap: 20px;

    &-facebook {
      background-image: url(../images/facebook.svg);
      @include hover (transform, scale(1.2));
    }

    &-twitter {
      background-image: url(../images/twitter.svg);
      @include hover (transform, scale(1.2));
    }

    &-telegram {
      background-image: url(../images/telegram.svg);
      @include hover (transform, scale(1.2));
    }

    &-instagram {
      background-image: url(../images/instagram.svg);
      @include hover (transform, scale(1.2));
    }
  }

  &__list {
    list-style: none;
    padding: 0 0 5px;
  }

  &__item {
    margin-bottom: 5px;

    @include onTablet {
      margin-bottom: 10px;
    }
  }

  &__link {
    font-size: 16px;
  }

  &__bottom {
    display: flex;
    justify-content: space-between;
    align-items: center;

    &-copyright {
      margin-right: 20px;
    }

    &__info {
      display: inline-block
    }

    &-scroll-up {
      background-image: url(../images/scroll_up.svg);
      background-position: center;
      background-repeat: no-repeat;
      height: 30px;
      width: 30px;

      @include hover (transform, scale(1.2))
    }
  }
}
